2226.objetoCompra:
Serviço de substituição de trechos de rede de óleo hidráulico pressurizado da Máquina de Reboque. Tal serviço deve comportar:
- Aquisição de todo material necessário para as tubulações;
- Realizar curvamento das tubulações conforme a necessidade do navio;
- Instalação de anilhas e conexões para melhor adaptação e disposição do sistema;
- Realizar manutenção nas válvulas do sistema;
- Pintar com tinta náutica para proteção do material da rede na cor cinza;
- Realizar testes de estanqueidade e funcionamento; e 
- Estabelecer garantia de no mínimo de 6 meses.

O serviço será realizado com a substituição dos seguintes trechos de rede:
- 2 trechos de rede de 15 metros de comprimento (totalizando 30 metros) em aço-carbono de 20mm de diâmetro, com espessura de 2mm na parede do tubo;
- 4 trechos de rede de 7 metros de comprimento (totalizando 28 metros) em aço-carbono de 12mm de diâmetro, com espessura de 2mm na parede do tubo; e
- 3 trechos de rede de 13 metros de comprimento (totalizando 39 metros) em aço-carbono de 18mm de diâmetro, com espessura de 2mm na parede do tubo.

Existem trechos de rede similares no navio que devem ser utilizados como modelos para confecção dos novos trechos para esse substituição, não devendo sair das características originais do navio.

